;маккуина - ремейк британского сериала про то , что у женщин яйца покруче , чем у мужчин . когда грабителей-мужей убивают , а деньги уничтожают , то за компенсацией приходят к их женам . фильм , снятый осознанно или нет в эру бьёт точно и больно , вы не увидите тут цельных мужских персонажей на первом плане . сияют тут жены во главе с виолой дэвис , которая наряду с женственностью и слабостью , великолепно отыгрывает силу и жесткость . кино работает на разных уровнях , маккуин создаёт сильное не столько высказывание , сколько плотную историю и показывает женскую природу под гнетом страха и принуждения . разножанровость и тематика тоже стоит отдельной похвалы , каждый увидит что-то своё ( 2018 ) . кристиан , молчаливый , растатуированный , прилежный в работе молодой человек устраиваться на работу в большой супермаркет и влюбляется в коллегу марион . когда фильм начинается с `` дуная ... '' шуберта , извините , я с собой не могу ничего поделать , ибо музыка сразу задаёт тон фильма . она обезоруживает и обвораживает . картина медленная , со статичной камерой , не без греха , но это атмосфера одного пространства , стеллажей , полок и рядов прекрасно сочетаются с исполнителями главных ролей . вы можете заскучать , но удовольствие вы все равно получите . - фильм иранского скандинава али аббаси о настоящих троллях среди нас . по сюжету девушка-пограничница обладает уникальным талантом определять неладное в приезжих . позже она встречает схожего с ней по внешности человека . неважно кто ты , тролль , иммигрант , приезжий , все равно ты будешь чувствовать себя чужаком . ожидая нечто схожее с впусти меня того же автора ( романа ) , ты натыкаешься на более глубокие проблемы , чем подростковое раскрепощение , и близость с кем-то похожим . стоит отметить грим , который убеждает , что это и вправду тролли . есьмирнедолжензнатьчтоясмотю ;[('маккуина', 'SYM'), ('-', ':'), ('ремейк', 'NN'), ('британского', 'JJ'), ('сериала', 'NNP'), ('про', 'NNP'), ('то', 'NNP'), (',', ','), ('что',